import React from 'react';
import './TrackList.css';
import Track from '../Track/Track'

class TrackList extends React.Component {
  render() {
    const tracks = this.props.track;
    return (
      <div className="TrackList">
        <Track key={tracks.id} name={tracks.name} artist={tracks.artist} album={tracks.album} isRemoval={false}/>
        {/*tracks.map((item) => 
          console.log(item.id)
          <Track key={item.id} name={item.name} artist={item.artist} album={item.album} isRemoval={false}/>
        )*/}
      </div>
    )
  }
}

export default TrackList;
